  04> WILLIAMS, Gerard John Paul (Gerry) m on 24.03.1973 to EWEN, Jennifer Helen
  b 18.03.1949
  b 09.01.1950
  Gerry b. at Napier. Jennifer, d/o Ian Alexander and Lila Ewen (Sargood Son & Ewen), b. at Wellington.
  Address: PO Box 612, Auckland 5.
  Gerry was educated at Hereworth School, Christ's College and Massey and Victoria Universities. He
  became a sharebroker in Wellington and subsequently Auckland before establishing his own International
  Trading Company in 1980. Gerry is currently Honorary Consul for the Republic of Chile, Principal of
  Pacific Basin Exports Ltd (ag exports) and SANZ Wool Marketing Ltd, and an active deer farmer in the
  Bombay Hills.
  01> WILLIAMS, Nicholas Ewen Marc
  b 01.09.1979
