  05>'WILLIAMS, Donald Campbell
  b 18.07.1911 d 12.12.1913
  Donald b. and d. (of scarlet fever) at Gisborne.
  06> WILLIAMS, Shona Mackintosh m on 09.12.1948 to KERSEY, Arthur Oliver (John)
  b 27.11.1914 d 09.06.1994
  b 27.03.1894 d 05.06.1962
  Shona b. at Gisborne. Arthur, s/o Arthur Edward Kersey and Sarah Pryke, b. near the village of Kersey,
  Suffolk, England.
  Shona was educated at Woodford House and trained as a NZ Registered nurse, now retired. John served in a
  British Regiment, the KSLI, in France in WW1 and was awarded an MC, Between the wars he enlisted in the
  Indian Army and served in the Mahratta Light Infantry rising to the rank of Brigadier and retiring in 1946
  as Colonel. He then came to New Zealand where he lived at Silverstream and worked as secretary of the
  Wellington Acclimatisation Society until his death.
